var env=new Primrose.BrowserEnvironment({font:"../shared_assets/fonts/helvetiker_regular.typeface.json",backgroundColor:0xC9E6EE,groundTexture:"../shared_assets/images/grass.png",useFog:!0,fullScreenButtonContainer:"#fullScreenButtonContainer",progress:Preloader.thunk}),treeReady=Primrose.Graphics.ModelFactory.loadModel("tree.obj");env.addEventListener("ready",function(){treeReady.then(function(e){for(var r=0;r<100;++r)e.clone().textured("Tree Bake Tex.jpg").named("tree"+r).addTo(env.scene).at(Primrose.Random.number(-25,25),0,Primrose.Random.number(-25,25)).rot(0,Primrose.Random.number(0,Math.PI),0).scl(1,Primrose.Random.number(.7,1.3),1);Preloader.hide()})});
